import React from 'react';
import {
    Text,
    View,
} from 'react-native';
import styles from '../styles/HomeScreen.style';

class HomeScreen extends React.Component {
    constructor() {
        super();
        const state = {
            color: "red"
        };
    }

    componentDidMount() {
        //add stuff
    }

    render() {
        return (
            <View style={styles.container}>
                <Text>Hey</Text>
            </View>
        );
    }
}

export default HomeScreen;
